import { View, Text } from 'react-native'
import React from 'react'
import reusable from './reusable.styles'

const Rating = ({rating}) => {
  return (
    <View style={reusable.rowWidthSpace}>
      <Text>Rating</Text>
    </View>
  )
}

export default Rating
